import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonCheckbox, IonList,
  IonItem, IonLabel, IonCard, IonCardContent, IonCardSubtitle, IonCardHeader, IonCardTitle,
  IonSelect, IonSelectOption, IonListHeader, IonItemDivider, IonButtons }
  from '@ionic/react';
import React, {useState} from 'react';
import { RouteComponentProps } from 'react-router';
import "../style/Notifications.css";

const SetProfile: React.FC<RouteComponentProps> = ({history}) => {
  const [bioSex, setBioSex] = useState<string>();
  const [preferredWeather, setPrefWeather] = useState<string>();

  return(
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Demographic Questions</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent>
        <IonCard>
          <IonList>
          <IonListHeader>
            <IonLabel>
              Please provide some information about yourself for our research.
            </IonLabel>
          </IonListHeader>

          <IonItem>
            <IonLabel>Biological Sex</IonLabel>
            <IonSelect value={bioSex} placeholder="Select One" onIonChange={e => setBioSex(e.detail.value)}>
              <IonSelectOption value="female">Female</IonSelectOption>
              <IonSelectOption value="male">Male</IonSelectOption>
              <IonSelectOption value="other">Other</IonSelectOption>
            </IonSelect>
          </IonItem>

          <IonItem>
            <IonLabel>What kind of weather do you normally prefer?</IonLabel>
            <IonSelect value={preferredWeather} placeholder= "Select One" onIonChange={e => setPrefWeather(e.detail.value)}>
              <IonSelectOption value="cold">Cold</IonSelectOption>
              <IonSelectOption value="cool">Cool</IonSelectOption>
              <IonSelectOption value="neutral">Neutral</IonSelectOption>
              <IonSelectOption value="warm">Warm</IonSelectOption>
              <IonSelectOption value="hot">Warm</IonSelectOption>
            </IonSelect>
          </IonItem>
        </IonList>
        </IonCard>
      </IonContent>
    </IonPage>

  );
};

export default SetProfile;
